import React from "react";
import "./Css/MapSection.css";

export default function MapSection() {
  return (
    <div className="mapSection">
      <iframe
        title="RS Associates Location"
        src=""
        width="100%"
        height="400"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
        referrerPolicy="no-referrer-when-downgrade"
      ></iframe>
    </div>
  );
}
